"DIALOG_PRIVACITY"=>"<p><span style=\"font-family: Tahoma;\">&#x00a0;</span></p> <div style=\"background-color: transparent; \"> <p dir=\"ltr\" id=\"internal-source-marker_0.9087853715755045\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 12pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Privacy Policy for Tagbum.com</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Tahoma;\">&#x00a0;</span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">What information do we collect?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;We collect information from you when you register on our site, place  an order, subscribe to our newsletter, respond to a survey, fill out a  form, or any other nature of business where information is collected.  &#x00a0;Any data we request that is not required will be specified as voluntary  or optional.&#x00a0; &#x00a0;When ordering or registering on our site, as  appropriate, you may be asked to enter your: name, e-mail address,  mailing address, phone number, credit card information or Oklahoma. You  may, however, visit our site anonymously. &#x00a0;Like most websites, we use  cookies to enhance your experience, gather general visitor information,  and track visits to our website. Please refer to the 'do we use  cookies?' section below for information about cookies and how we use  them.</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> </span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">What do we use your information for?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;Any of the information we collect from you may be used in one of the  following ways:&#x00a0; &#x00a0;;&#x00a0;To personalize your experience (your information  helps us to better respond to your individual needs) &#x00a0;;&#x00a0;To improve our  website (we continually strive to improve our website offerings based on  the information and feedback we receive from you) &#x00a0;;&#x00a0;To improve  customer service (your information helps us to more effectively respond  to your customer service requests and support needs) &#x00a0;;&#x00a0;To process  transactions Your information, whether public or private, will not be  sold, exchanged, transferred, or given to any other company for any  reason whatsoever, without your consent, other than for the express  purpose of delivering the purchased product or service requested by the  customer.&#x00a0; &#x00a0;;&#x00a0;To send periodic emails &#x00a0;The email address you provide for  order processing, may be used to send you information and updates  pertaining to your order or request, in addition to receiving occasional  company news, updates, promotions, related product or service  information, etc. &#x00a0;Note: If at any time you would like to unsubscribe  from receiving future emails, we include detailed unsubscribe  instructions at the bottom of each email. &#x00a0;;&#x00a0;To administer a contest,  promotion, survey or other site feature &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">How do we protect your information?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;We implement a variety of security measures to maintain the safety of  your personal information when you submit a request, place an order or  enter, submit, or access your personal information.&#x00a0; &#x00a0;These security  measures include: password protected directories and databases to  safeguard your information, SSL (Secure Sockets Layered) technology to  ensure that your information is fully encrypted and sent across the  Internet securely or PCI Scanning to actively protect our servers from  hackers and other vulnerabilities.&#x00a0; &#x00a0;We offer the use of a secure  server. All supplied sensitive/credit information is transmitted via  Secure Socket Layer (SSL) technology and then encrypted into our Payment  gateway providers database only to be accessible by those authorized  with special access rights to such systems, and are required to keep the  information confidential. &#x00a0;After a transaction, your private  information (credit cards, social security numbers, financials, etc.)  will not be stored on our servers. &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Do we use cookies?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;Yes (Cookies are small files that a site or its service provider  transfers to your computers hard drive through your Web browser if you  allow) that enables the sites or service providers systems to recognize  your browser and capture and remember certain information. &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Do we disclose any information to outside parties?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;We do not sell, trade, or otherwise transfer to outside parties your  personally identifiable information. This does not include trusted third  parties who assist us in operating our website, conducting our  business, or servicing you, so long as those parties agree to keep this  information confidential. We may also release your information when we  believe release is appropriate to comply with the law, enforce our site  policies, or protect ours or others' rights, property, or safety.  However, non-personally identifiable visitor information may be provided  to other parties for marketing, advertising, or other uses. &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Third party links</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;Occasionally, at our discretion, we may include or offer third party  products or services on our website. These third party sites have  separate and independent privacy policies. We therefore have no  responsibility or liability for the content and activities of these  linked sites. Nonetheless, we seek to protect the integrity of our site  and welcome any feedback about these sites. &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">California Online Privacy Protection Act Compliance</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">  &#x00a0;Because we value your privacy we have taken the necessary precautions  to be in compliance with the California Online Privacy Protection Act.  We therefore will not distribute your personal information to outside  parties without your consent. &#x00a0;As part of the California Online Privacy  Protection Act, all users of our site may make any changes to their  information at anytime by logging into their control panel and going to  the <strong>Edit Profile</strong> page.</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Childrens Online Privacy Protection Act Compliance</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;We are in compliance with the requirements of COPPA (Childrens Online  Privacy Protection Act), we do not collect any information from anyone  under 13 years of age. Our website, products and services are all  directed to people who are at least 13 years old or older. &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">CAN-SPAM Compliance</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;We have taken the necessary steps to ensure that we are compliant with  the CAN-SPAM Act of 2003 by never sending out misleading information. &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Online Privacy Policy Only</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;This online privacy policy applies only to information collected  through our website and not to information collected offline. &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Terms and Conditions</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;Please also visit our Terms and Conditions section establishing the  use, disclaimers, and limitations of liability governing the use of our  website at https://www.tagbum.com &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Your Consent</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0; &#x00a0;By using our site, you consent to our privacy policy. &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Changes to our Privacy Policy</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0;  &#x00a0;If we decide to change our privacy policy, we will update the Privacy  Policy modification date below. Policy changes will apply only to  information collected after the date of the change.&#x00a0; &#x00a0;This policy was  last modified on&#x00a0;</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">October 1, 2011</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Contacting Us</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&#x00a0; &#x00a0;If there are any questions regarding this privacy policy you may contact us using the information below.&#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><img height=\"40px;\" width=\"150px;\" src=\"https://lh6.googleusercontent.com/JeJRRarMng8bETDzkWNn4Hi8TeFhA0xhXitOqhxfKS_n7kBStIFlHkqnh0OrMr6J0RogfroU5QtJRwaPoyfAzom6y9ouLcHJ6AR3EsgLqlJt4pvUm_0\" alt=\"\"></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">https://www.tagbum.com 5830 NW Expressway, #347 Oklahoma City, OK 73132 United States privacy@tagbum.com &#x00a0;</span></span></p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">&#x00a0;</p> <p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Privacy Policy Customer Pledge</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">  &#x00a0;We pledge to you, our customer, that we have made a dedicated effort  to bring our privacy policy in line with the the following important  privacy laws and initiatives: Federal Trade Commision Fair Childrens  Online Privacy Protection Act Privacy Alliance Controlling the Assault  of Non-Solicited Pornography and Marketing Act Trust Guard Privacy  Requirements</span></span></p> </div> <p><span style=\"font-family: Tahoma;\">&#x00a0;</span></p>",
