"INDEX_DIALOGABOUT"=>"<p><span style=\"font-size: medium;\"><em><strong>TagBum is a social network that gives you points to redeem for prizes</strong></em></span></p> <p style=\"text-align: justify;\"><span style=\"font-size: small;\"><strong>Tagbum.com&nbsp;</strong>comes with a new approach, which is to create, share tags, and earn points. This translates into rewards for their users, with the ability to redeem these points for products/services in their virtual store.</span></p> <p style=\"text-align: justify;\"><span style=\"font-size: small;\">This system provides two types of subscription, personal profile (which is completely free), and a company profile (90-day FREE promotion). It allows you to create your own tags, will to hold up to three types of written messages with a color palette of your choice, to personalize each of your tags. The Web provides the option to upload videos from <strong>Youtube</strong>, <strong>Vimeo </strong>and/or upload <strong>P</strong><strong>ersonal videos</strong>.</span></p> <p style=\"text-align: justify;\"><span style=\"font-size: small;\">The Social Network does not limit the number of friends allowed, you can share, comment, edit and sponsor tags; has a privacy tool that allows you to control who can see your publications; also have the options: &ldquo;I like&rdquo;, &ldquo;dislike&rdquo;, &ldquo;share&rdquo;, &ldquo;friends&rdquo; and &ldquo;report&rdquo; tags with contents that may cause inconvenience to users of the community. The creators of this web, designed a virtual store where users can buy and sell products and services, access raffles and contests by using points accumulated with their tags, in the following categories, (including, but not limited to): Audio devices, game consoles, clothing, accessories, instruments and music among others. You can also create chat rooms with real-time video chat, (which does not need any additional download); create public and private groups, games arcade, and a carousel of tags. The Hot Zone is another option where the most popular tags are displayed (daily, weekly or monthly).</span></p> <p><span style=\"color: rgb(255, 102, 0);\"><span style=\"font-size: medium;\"><strong><em>About this Social Network</em></strong></span></span></p> <p style=\"text-align: justify;\"><span style=\"font-size: small;\">During this last decade we have witnessed the rapid increase of global telecommunications in different areas of society, one of them being social networks, with the US being the prominent developer of projects such as: Facebook, Twitter, Instagram, etc., which enable users to meet, talk, buy and sell products and services.</span></p> <p style=\"text-align: justify;\"><span style=\"font-size: small;\">For these cited reasons, in 2010, a new social network called <strong>Seemytag.com</strong> evolved after many conversations among the founders, Venezuelan, Jorge Ortuno (engineer residing in the United States) Tim Riley, and seven Venezuelan programmers. They collaborated and developed a project beta called <strong>Tagbum.com</strong> that was approved by Google Play and the Apple Store in June 2013.</span></p> <p style=\"text-align: justify;\"><span style=\"font-size: small;\">The current domain called <strong>Tagbum.com</strong> is in Google Play and it is in the approval system for the Apple Store, has over 100,000 users on its platform, more than 10,000 followers on Twitter, and more than 45,000 &ldquo;like&rdquo; on its official Facebook page. Everyday <strong>Tagbum.com</strong> continues to increase its audience.</span></p> <p style=\"text-align: justify;\"><span style=\"font-size: small;\">Since November 12, 2014, <strong>Tagbum.com</strong> started its &ldquo;day view&rdquo; in Venezuela, with different activities and events undertaken by the Manager of the Social Network for Venezuela and its working group. In the coming days we will be holding events and raffles for users with the best publications (Tags), which breaks with traditional schemes of other social networks, allowing direct contact between users and the project.</span></p> <p style=\"text-align: justify;\"><span style=\"font-size: small;\">The <strong>slogan of tagbum.com</strong> is create, share and collect points to redeem for prizes.&nbsp;</span></p>",
